/*for Pages : 
lists, myday, alltasks, important
*/
/*contains:
not completed, completed
*/

/* For page Planned task*/
/*contains
earlier ,today ,later
*/
import React from "react";
import "../CSS/planned.css";
import "../App.css";
import { Task } from "../components/task.tsx";

interface taskprop {
  name: String;
  dueDate: Date;
  important: boolean;
  repeat: boolean;
  completed: boolean;
  taskID: String;
}

interface importantProp {
  allTask: taskprop[];
}

export function Important({ allTask }: importantProp) {
  const plannedIcon = require("../Images/sidebar-box.png");

  return (
    <div className="planned">
      <div className="planned-heading">
        <img src={plannedIcon} alt="planned"></img>
        <div>Important</div>
      </div>
      <br />
      <br />
      <div className="planned-parts">
        <div>
          {allTask.map((obj, index) => (
            <>
              <Task {...obj} />
              <br />
            </>
          ))}
        </div>
      </div>
      <br />
      <br />
    </div>
  );
}
